import BoardFactory from "./Board";

const ChessFactory = () => {

    return Object.create({
        board: BoardFactory(),
        boardToString() {
            let boardString = '';

            this.board.board.forEach(element => {
                boardString = boardString.concat('\n');
                element.forEach(piece => {
                    if (piece === undefined || piece === null) {
                        console.log('here')
                        boardString = boardString.concat('null, ')
                    } else {
                        boardString = boardString.concat(`${piece.piece}`);
                    }
                })
            });
            console.log(boardString);
        }
    })

}

export default ChessFactory;
